{"id":"xhpyZgJXJqgC","term":"Philip K Dick","author":"Philip K. Dick","category":"Fiction","title":"Le roi des elfes","authors":["Philip K. Dick"],"publisher":"Editions Gallimard","description":"Rien n’avait préparé Shadrach Jones à voir arriver le roi des elfes et sa suite au grand complet dans sa station-service. Et pourtant, aussi incroyable que cela paraisse, il est bien là, devant lui, et plutôt mal en point. Les derniers mutants qui menacent encore la Terre sont traqués à mort. Mais Cris Johnson, cet homme intégralement doré et à la beauté divine, peut-il être un monstre? Ernest Elwood est plutôt rêveur, ces derniers temps. Rien d’autre ne semble l’intéresser que la construction de son bateau, comme s’il était manipulé. En neuf nouvelles, Philip K. Dick montre une fois de plus toute l’étendue de son talent, qu’il aborde la science-fiction, le fantastique et même, sans doute pour la seule fois, la fantasy.","categories":["Fiction"],"language":"fr"}
